export default props => {

  return (
    <form onSubmit={handleCommentary}>
      <input onChange={(e) => {
        setCommentary(e.target.value)
      }} type="text" placeholder="Make a commentary ..." value={commentary} />
      <input type="submit" style={{display: 'none'}} />
    </form>
  )

}
